using System;
using System.Linq;
using System.Net;
using System.Net.Http;
using System.Net.Http.Headers;
using System.Threading.Tasks;
using Microsoft.Azure.WebJobs;
using Microsoft.Azure.WebJobs.Extensions.Http;
using Microsoft.Azure.WebJobs.Host;
using Newtonsoft.Json;

namespace AzureBootcamp.Functions
{
    public static class Functions
    {
        private static string _logicAppUrl = "https://prod-11.northeurope.logic.azure.com:443/workflows/a792560d5b2a4e21b8d455bd86b836ff/triggers/manual/paths/invoke?api-version=2016-10-01&sp=%2Ftriggers%2Fmanual%2Frun&sv=1.0&sig=BpQ8o49fCa-E_aahcgYP4oKHNG46C__SaQzw5S3_Qos";
        private static string _cameraAppUrl;
        //private static string _cameraAppUrl = "http://lloyd.synology.me:52042/api/Camera";

        [FunctionName("TheFunction")]
        public static async Task<HttpResponseMessage> Run([HttpTrigger(AuthorizationLevel.Anonymous, "get", "post", Route = "TheFunction")]HttpRequestMessage req, TraceWriter log)
        {            
            // parse query parameter
            string message = req.GetQueryNameValuePairs()
                .FirstOrDefault(q => string.Compare(q.Key, "message", true) == 0)
                .Value;

            // Get request body
            dynamic data = await req.Content.ReadAsAsync<object>();

            // Set name to query string or body data
            message = message ?? data?.message;

            string binaryImage = "data:image/jpeg;base64,";

            // Calla camera service to get an image
            if (_cameraAppUrl != null)
            {
                using (var client = new HttpClient())
                {
                    client.BaseAddress = new Uri(_cameraAppUrl);
                    var result = await client.GetAsync("");
                    binaryImage = await result.Content.ReadAsStringAsync();
                    binaryImage = binaryImage.Replace("\"", ""); // 
                }
            }

            // Call Logic app to trigger Twitter
            using (var client = new HttpClient())
            {
                var myContent = JsonConvert.SerializeObject(new Message()
                {
                    message = message,
                    binaryImage = binaryImage
                });

                var buffer = System.Text.Encoding.UTF8.GetBytes(myContent);
                var byteContent = new ByteArrayContent(buffer);
                byteContent.Headers.ContentType = new MediaTypeHeaderValue("application/json");
                
                var uri = new Uri(_logicAppUrl);
                var result = await client.PostAsync(uri, byteContent);
                string resultContent = await result.Content.ReadAsStringAsync();
                log.Info(resultContent);
            }

            return message == null
                ? req.CreateResponse(HttpStatusCode.BadRequest, "Please pass a message in the request body")
                : req.CreateResponse(HttpStatusCode.OK, message);
        }
    }

    public class Message
    {
        public string message { get; set; }
        public string binaryImage { get; set; }
    }
}
